  'linear-gradient': '<!DOCTYPE html><html lang="en"><head><meta charset="UTF-8"/><title>CSS3线性渐变（Linear Gradients）</title><style>.gradient{display:inline-block;width:40%;font-size:18px;font-weight:bold;color:#fff;text-align:center;padding:50px 0;margin:10px}</style></head><body><h3>CSS3线性渐变（Linear Gradients）</h3><div class="gradient"style="background: linear-gradient(to top, #FF2D2D, #0080FF);">从下向上to top(0deg/360deg)<br/>background:linear-gradient(to top,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to right, #FF2D2D, #0080FF);">从左向右to right(90deg)<br/>background:linear-gradient(to right,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to bottom, #FF2D2D, #0080FF);">(默认值)从上向下to bottom(180deg)<br/>background:linear-gradient(to bottom,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to left, #FF2D2D, #0080FF);">从右向左to left(270deg)<br/>background:linear-gradient(to left,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to top right, #FF2D2D, #0080FF);">左下角到右上角to top right(45deg)<br/>background:linear-gradient(to top right,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to bottom right, #FF2D2D, #0080FF);">左上角到右下角to bottom right(135deg)<br/>background:linear-gradient(to bottom right,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to bottom left, #FF2D2D, #0080FF);">右上角到左下角to bottom left(225deg)<br/>background:linear-gradient(to bottom left,#FF2D2D,#0080FF);</div><div class="gradient"style="background: linear-gradient(to top left, #FF2D2D, #0080FF);">右下角到左上角to top left(315deg)<br/>background:linear-gradient(to top left,#FF2D2D,#0080FF);</div><p><strong>注意：</strong>Internet Explorer 9及之前的版本不支持渐变。</p></body></html>',
  'css3-gradient': '<!doctype html><html lang="en"><head><meta charset="UTF-8"><title>CSS3渐变效果图对比</title></head><body><div style="display:inline-block;"><p>线性渐变</p><p style="width: 150px;height: 150px;background-image: linear-gradient(to top,red 0%,blue 50%,green 100%);"></p></div><div style="display:inline-block;"><p>径向渐变</p><p style="width: 150px;height: 150px;background-image:radial-gradient(100px at center center,red 0%,blue 50%,green 100%);"></p></div><div style="display:inline-block;"><p>重复线性渐变</p><p style="width: 150px;height: 150px;background-image:repeating-linear-gradient(red, yellow 10%, green 20%);"></p></div><div style="display:inline-block;"><p>重复径向渐变</p><p style="width: 150px;height: 150px;background-image: repeating-radial-gradient(5px at 0px 0px,red 0%,blue 50%,green 100%);"></p></div><div style="display:inline-block;"><p>重复径向渐变</p><p style="width: 150px;height: 150px;background-image:repeating-radial-gradient(40px at center center,red 0%,blue 50%,green 100%);"></p></div></body></html>',
  'constructor': '<!DOCTYPE html><html><head><meta charset="utf-8"><title>constructor属性</title></head><body><p>判断是否为数组。</p><p id="demo1"></p><p>判断是否为日期。</p><p id="demo2"></p><script>var fruits=["Banana","Orange","Apple","Mango"];document.getElementById("demo1").innerHTML=isArray(fruits);var myDate=new Date();document.getElementById("demo2").innerHTML=isDate(myDate);function isArray(myArray){return myArray.constructor.toString().indexOf("Array")>-1}function isDate(myDate){return myDate.constructor.toString().indexOf("Date")>-1}</script></body></html>'
